libs.content:
find_library(${base_name_u}_lib
		names ${_${base_name_u}_libraries} ${lib_name} lib${lib_name}
		hints
			env obspath32
			env obspath
			${obspath}
			${_${base_name_u}_library_dirs}
		paths
			/usr/lib /usr/local/lib /opt/local/lib /sw/lib
		path_suffixes
			lib32 lib
			libs32 libs
			bin32 bin
			../lib32 ../lib
			../libs32 ../libs
			../bin32 ../bin

			${_build_type_${repo_build_path}}
			${_build_type_${repo_build_path}32}
			build/${repo_build_path}
			build32/${repo_build_path}

			build32/${repo_build_path}/debug
			build32/${repo_build_path}/relwithdebinfo
			build/${repo_build_path}/debug
			build/${repo_build_path}/relwithdebinfo
		)
